import './App.css';

function changeBackgroundColor(color) {
    document.body.style.backgroundColor = color;
  }

function	App()
{
	return (
		<React.Fragment>
			<div className="App">
				<h1 onMouseOver={changeBackgroundColor('adff2f')}>TRANSCENDANCE</h1>
			</div>
			<div className="Content">
				<h1>PLAY</h1>
			</div>
		</React.Fragment>
	);
}

export default App;
